import React from 'react'

function Contact() {
   return (
        <section class= "bg-[#d4af37]">

            <div class="max-w-screen lg:h-[300px] md:h-[300px] sm:h-[500px] -translate-y-40 bg-[#d4af37] grid w-screen-xl px-4 py-20 mx-auto lg:gap-15 xl:gap-0 lg:py-20 lg:grid-cols-12">
                <div class="skew-y-2 translate-x-10">
                </div>
            </div> 

    </section>
   )

}

export default Contact;
